import React from 'react';
import SearchBox from './SearchBox';
import Card from './Card';
import 'tachyons';
import {robots} from './robots';

const App = () =>{
  return (
    <div className='tc'>
      <h1>Robocops</h1>
      < SearchBox />
      < Card robots={robots} />
    </div>
  );
}












export default App;
